<h3 class="articletitle">Oornnmene</h3>
Oornnmene is a striated glossey brown sedimentary rock Oornnmene's properties are entirly mundane and is uniquly useful in the creation of rope. Oornnmene was first discovered by the trader <a href="../people/ElenaOwenv912lt3hz3.html">Elena Owen</a> within the <a href="../localregions/Az̄ihadiz̄oBasin.html">Az̄ihadiz̄o Basin</a> durring the late 10th century.
